The team of experts are looking for highly energetic, junior level financial professionals who are eager to build on their experience working in financial services and the banking industry. This role demands use of analytical ability and strong organizational skills to solve complex problems. The work will involve both execution and oversight of engagement work streams that may be either qualitative or quantitative in nature, and responsibilities include: business process reviews, current state assessments, developing roadmaps to improve operations, compliance or control, assisting clients with technology enablement and dashboard reporting, financial and accounting reviews, management of junior staff, quality control, development and presentation of client deliverables, management of existing client relationships, industry research, and expansion of business.
Responsibilities
Plan and manage all aspects or certain aspects of client engagements depending on their size and complexity.
Participate in group practice meetings, and contribute to business development initiatives and office functions such as staff training and recruiting.
Prioritize assignments and responsibilities in order to meet goals and deadlines.
Work directly with senior staff to develop new data analytics tools and products.
Works in areas that encompass regulatory, risk and controls; finance and accounting; technology enablement; and business process optimization.
Works on data intensive projects, including analytics, governance, and manipulation, to support a variety of financial risk initiatives.
Demonstrate creativity and efficient use of relevant software tools, analytical methods and computer models to develop solutions.
Financial Industry / Product Knowledge
Prior work experience with Financial Institutions and / or management consulting involved with the following activities is highly preferred:
Banking
Mortgage (originators, servicers, secondary marketing, GSEs)
Auto Finance
Student Loans
Commercial Loans
Cyber Security / Data Privacy
Insurance
Functional Capabilities
Prior skills or experience working in the following topical areas is highly preferred:
Risk and Control Assessments;
Process mapping/flows;
Assessment of compliance with consumer regulations (CFPB / OCC / Federal Reserve / State Law Requirements);
Business process remediation;
Consumer compliance testing and financial harm analysis;
Business analysts (user requirement development / user acceptance testing);
Quantitative / Qualitative analysis;
Valuation of financial instruments;
Project / program managers.
Qualifications
A Bachelor's degree in business, accounting, finance, economics, statistics, or a related field; MS/MBA would be a nice to have
Minimum one to three (1-3) years’ experience (preferably with a Big Four) with a focus on financial services;
Proven, working knowledge of SQL;
Experience with Business Intelligence tools (Tableau preferred, but other BI tools are acceptable);
Strong PowerPoint presentation skills/techniques with ability to create decks and agendas that provide robust transparency as to project status;
Proven capability with Microsoft Excel. A desire to expand those capabilities is required, as is the ability to train others to use such tools;
Strong verbal and written communication skills;
Ability to travel to client sites on demand required;
Data analysis background (either via degree, concentration, or work experience);
Ability to work independently / problem solve; and
Python and other coding languages a plus.
Salary Range: $100,000 - $140,000 per year.

Do not post externally

Hitapps is a GameDev company specializing in two areas: Hybrid-casual & Casual (Puzzle/Brain Teasers). We have several successful products in both categories with a combined total of over 80 000 000 downloads, and we are currently featured in the top charts in the Games section. We adhere to principles of openness and transparency, and we are results-oriented while valuing work-life balance.

We are currently searching for a skilled Data Analyst whom we can confidently entrust with the analysis of our products.
Responsibilities:
Creating a predictive model for the LTV of company products;
Evaluating the effectiveness of traffic acquisition campaigns for iOS/Android applications;
Collecting and visualizing data for report generation;
Conducting A/B tests and analyzing their results;
Analyzing key product metrics;
Conducting research and discovering new insights within the data.
Why you?
Minimum 3 years of work experience in the Gamedev industry;
Understanding of marketing and gaming metrics (LTV, ROI, ROAS, ARPU, ARPPU);
Experience with databases, proficient in SQL;
Experience in using Python for data processing and analysis;
Experience with BI tools (Tableau/Power BI/Data Studio/Redash);
Strong knowledge of mathematical statistics and A/B testing methods.
Why us?
Official employment;
High salary level;
Medical insurance;
100% compensation for vacations, sick leave, and day-offs;
Compensation for educational and sports activities;
Work in a team without bureaucracy;
Opportunity to influence processes within the department.
